import React, {Component} from 'react';
import axios from 'axios';
import {Col, Badge} from 'react-bootstrap';

axios.defaults.withCredentials = true;
const headers = {withCredentials: true};

class MyPostItems extends Component {
    render(){
        const myPosts = this.props.entries.map((post)=>{
            return <Col md={{ span: 6, offset: 3 }}>
                        <tr key={post.id} createdAt={post.createdAt} >
                            <td>{post.content}</td><Badge variant="success">{post.member.nickname}</Badge>
                        </tr>
                    </Col>
        });
        return(
            <div>
                <table>{myPosts}</table>
            </div>
        );
    }
}

export default MyPostItems;
